import './App.css';

function App(){
    return(
        <div className="App">
            <div className="flexbox-centered-item">
                <h1>Japanese Learning</h1>
                <p1>I'm developing this website as a Japanese learner to develop exersises and resourse that will aid me in my learning.</p1>
            </div>
        </div>
    );
}

export default App;
